class 'CategoriaFrete'

function CategoriaFrete:__init(args)
	
	self.visivel = false
	self.active = false
	self.entregaSelecionada = 1

	if args then 
	
		if args.idCategoria then
			self.idCategoria = tonumber(args.idCategoria)
		else
			self.idCategoria = 1
		end
		
		if args.nome then
			self.nome = args.nome
		else
			self.nome = "null"
		end
		
	end
	
	self.imagens = {}
	self.imagens[1] = Image.Create(AssetLocation.Base64, "")
	self.imagens[2] = Image.Create(AssetLocation.Base64, "")
	self.imagens[3] = Image.Create(AssetLocation.Base64, "")
	self.imagens[4] = Image.Create(AssetLocation.Base64, "")
	
	
	self.imagem = nil		
	if self.idCategoria then
	
		if self.idCategoria then
			if self.imagens[self.idCategoria] then
				self.imagem = self.imagens[self.idCategoria]
			end
		end
	end

	
	if self.imagem then
		self.imagem:SetSize(self.imagem:GetSize() * 0.5)
	end
	
	self.entregas = {}
	
	Events:Subscribe("KeyDown", self, self.KeyDown)
	Events:Subscribe("PostTick", self, self.PostTick)
	
	self.timerExpiracao = Timer()
	
end


function CategoriaFrete:PostTick()

	if self.timerExpiracao:GetMinutes() > 2 then
			
		for _, e in pairs(self.entregas) do
		
			e.tempo = e.tempo - 2
			if e.tempo <= 0 then
				table.remove(self.entregas, _)
			end
		
		end
		self.timerExpiracao:Restart()
	end


end


function CategoriaFrete:GetEntregaSelecionada()

	if self.entregas[self.entregaSelecionada] then
		return self.entregas[self.entregaSelecionada]
	else
		return nil
	end
	
end


function CategoriaFrete:SetVisivel(boo)

	self.visivel = boo

end


function CategoriaFrete:SetActive(boo)

	self.active = boo

end


function CategoriaFrete:AddEntrega(entrega)

	-- Chat:Print(tostring(entrega.mercadoria), Color(1,1,0))
	table.insert(self.entregas, entrega)
	
end


function CategoriaFrete:KeyDown(args)

	if self.active and self.visivel then
	
		if args.key == 40 then
			
			if self.entregaSelecionada < #self.entregas then
				self.entregaSelecionada = self.entregaSelecionada + 1
			else
				self.entregaSelecionada = 1
			end
			
		end
		
		
		if args.key == 38 then
			
			if self.entregaSelecionada > 1 then
				self.entregaSelecionada = self.entregaSelecionada - 1
			else
				self.entregaSelecionada = #self.entregas
			end
			
		end
		
		-- enter
		if args.key == 13 then

			if self.entregas[self.entregaSelecionada] then
			
				Waypoint:SetPosition(self.entregas[self.entregaSelecionada].descargas[1])
				Chat:Print("Seu GPS foi marcado para o inicio do servico!", Color(255,255,200))
			
			end
			
		end
		
	end
end